     4	private traderOrder DeterminePrice() {
     5	        float lastPrice = orderBook.lastTradedPrice;
     6	        int shortMA = orderBook.MA5;
     7	        int longMA = orderBook.MA25;
     8	        float shortTrend = (lastPrice - shortMA) / shortMA;
     9	        float longTrend = (lastPrice - longMA) / longMA;
    10	
    11	        bool Maker = rng.NextDouble() < orderBook.proportionMaker;
    12	        float randFactor = 1f + ((float)rng.NextDouble() * 0.02f - 0.01f);
    13	        int randP = Mathf.RoundToInt(lastPrice * randFactor + 0.5f * Mathf.Sign(randFactor - 1f));
    14	        if (Maker) {
    15	            if (randP > lastPrice)
    16	                return new traderOrder(randP, rng.Next(40) + 1, false);
    17	            else
    18	                return new traderOrder(randP, rng.Next(40) + 1, true);
    19	        } else {
    20	            if (randP > lastPrice)
    21	                return new traderOrder(randP, rng.Next(20) + 1, true);
    22	            else
    23	                return new traderOrder(randP, rng.Next(20) + 1, false);
    24	        }
