    27	Orders are added to the orderBook, separated by buys and sells:
    28	
    29	public void PlaceOrder(int price, int quantity, bool isBuy) {
    30	        if (price > 0 && quantity > 0) {
    31	            if (isBuy) {//Buy
    32	                if (sellBook.Count > 0 && price > BestAsk)
    33	                    TakeOrder(price, quantity, isBuy);
    34	                else
    35	                    MakeOrder(price, quantity, isBuy);
    36	            } else {//Sell
    37	                if (buyBook.Count > 0 && price < BestBid)
    38	                    TakeOrder(price, quantity, isBuy);
    39	                else
    40	                    MakeOrder(price, quantity, isBuy);
    41	            }
    42	        }
    43	    }
    44	And Taker orders will run through the orderbook until the order quantity is exhausted:
    45	
    46	private void TakeOrder(int p, int q, bool b) {
    47	        int rQ = q;
    48	        lastTradedPrice = market.lastPrice;
    49	        int i = 0;
    50	
    51	        while (rQ > 0) {
    52	            i++;
    53	            if (b) {
    54	                if (sellBook.Count == 0) {
    55	                    BestAsk = int.MaxValue;
    56	                    break;
    57	                }
    58	                BestAsk = sellBook.Keys.First();
    59	
    60	                if (p < BestAsk)
    61	                    break;
    62	                int aQ = sellBook[BestAsk];
    63	                if (aQ > 0) {
    64	                    int tQ = Mathf.Min(aQ, rQ);
    65	                    sellBook[BestAsk] -= tQ;
    66	                    rQ -= tQ;
    67	                    totalBuyVolume -= tQ;
    68	                    lastTradedPrice = BestAsk;
    69	                    market.liveCandlestick.UpdateWithTrade(BestAsk, tQ);
    70	                    market.chart.UpdateLiveCandle(p, market.liveCandlestick.volume, market.liveCandlestick.high, market.liveCandlestick.low);
    71	
    72	                    if (sellBook[BestAsk] <= 0) {
    73	                        sellBook.Remove(BestAsk);
    74	                        BestAsk = sellBook.Count > 0 ? sellBook.Keys.First() : int.MaxValue;
    75	                    }
    76	                }
    77	            } else {
    78	                ...same but opposite for sells
    79	                }
    80	            }
    81	        }
    82	
    83	        market.lastPrice = lastTradedPrice;
    84	        if (totalBuyVolume + totalSellVolume > 0)
    85	            imbalance = (totalBuyVolume - totalSellVolume) / (totalBuyVolume + totalSellVolume);
    86	        else
    87	            imbalance = 0;
    88	
    89	        if (rQ > 0) {
    90	            MakeOrder(p, rQ, b);
    91	        }
    92	    }
