    94	And Maker orders are just added to the orderBook. Unity has some weird key logic, I'm using a dictionary, but Pandas has some excellent array organizers where you can literally just search for a key in a list:
    95	
    96	private void MakeOrder(int price, int quantity, bool isBuy) {
    97	        if (isBuy) {
    98	            if (buyBook.ContainsKey(price)) {
    99	                if (buyBook[price] > 0)
   100	                    buyBook[price] += quantity;
   101	                else
   102	                    buyBook[price] = quantity;
   103	            } else
   104	                buyBook[price] = quantity;
   105	            totalBuyVolume += quantity;
   106	            if (price > BestBid)
   107	                BestBid = price;
